import React, { useState } from 'react'
import 'hts-react-form/styles/default.css'
import { HTSReactForm } from 'hts-react-form'

export default function DriverSearchByLocation() {
    const [patientName, setPatientName] = React.useState(["Patient Name"]);
    const [patientPickupAddress, setPatientPickupAddress] = React.useState(["Pickup Address"]);
    const [patientPickupTime, setPatientPickupTime] = React.useState(["Pickup Time"]);
    const [patientNotes, setPatientNotes] = React.useState(["Patient Notes"]);

  return (
    <HTSReactForm
      controls={[
        {
          label: 'Email',
          type: 'text',
          name: 'email',
          value: patientName,
          required: true,
        },
        {
          label: 'Password',
          type: 'password',
          name: 'password',
          value: patientPickupAddress,
          required: true,
        },
      ]}
    />
  )
}
